import { host,httpRequest,access_token } from './host'



export let getUsers = () => {
    let config = {
      url: `${host}/users/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getStudents = () => {
    let config = {
      url: `${host}/students/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getStudent1 = () => {
    let config = {
      url: `${host}/users/?only=s`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getCourse = () => {
    let config = {
      url: `${host}/courses/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getAdmins = () => {
    let config = {
      url: `${host}/admins/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getInstructors = () => {
    let config = {
      url: `${host}/instructors/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export let getTimeslots = () => {
    let config = {
      url: `${host}/time-slots/`,
      method: "GET",
        headers: {
          'Authorization': `Token ${access_token}`
        }
    };
    return httpRequest(config);
  }

  export const deleteTimeslots= key => {
    let config = {
        url: `${host}/time-slots/${key}/`,
        method: "delete",
        headers: {
          'Authorization': `Token ${access_token}`,
        }
      };
      return httpRequest(config);
    };

  export const deleteUser= key => {
  let config = {
      url: `${host}/users/${key}/`,
      method: "delete",
      headers: {
        'Authorization': `Token ${access_token}`,
      }
    };
    return httpRequest(config);
  };

  export const deleteCourse= key => {
    let config = {
        url: `${host}/courses/${key}/`,
        method: "delete",
        headers: {
          'Authorization': `Token ${access_token}`,
        }
      };
      return httpRequest(config);
    };

  export const deleteSG1= key => {
    let config = {
        url: `${host}/group-students/${key}/`,
        method: "delete",
        headers: {
          'Authorization': `Token ${access_token}`,
        }
      };
      return httpRequest(config);
    };

    export const deleteGroup= key => {
    let config = {
        url: `${host}/groups/${key}/`,
        method: "delete",
        headers: {
          'Authorization': `Token ${access_token}`,
        }
      };
      return httpRequest(config);
    };

  export const deleteStudent= key => {
    let config = {
        url: `${host}/users/${key}/`,
        method: "delete",
        headers: {
          'Authorization': `Token ${access_token}`,
        }
      };
      return httpRequest(config);
    };

    export const postUsers= (formDataObj) => {
    let config = {
        url: `${host}/users/`,
        method: "post",
        data: formDataObj,
        headers: {
          'Authorization': `Token ${access_token}`,
          "Content-Type": "multipart/form-data"
        }
      };
      return httpRequest(config);
    };
    export const postTimeslot= (formDataObj) => {
      let config = {
          url: `${host}/time-slots/`,
          method: "post",
          data: formDataObj,
          headers: {
            'Authorization': `Token ${access_token}`,
            "Content-Type": "multipart/form-data"
          }
        };
        return httpRequest(config);
      };

    export const postCourse= (formDataObj) => {
      let config = {
          url: `${host}/courses/`,
          method: "post",
          data: formDataObj,
          headers: {
            'Authorization': `Token ${access_token}`,
          }
        };
        return httpRequest(config);
      };

      export const postGroup1= (formDataObj) => {
        let config = {
            url: `${host}/groups/`,
            method: "post",
            data: formDataObj,
            headers: {
              'Authorization': `Token ${access_token}`,
            }
          };
          return httpRequest(config);
        };

    export let getGroup= () => {
      let config = {
        url: `${host}/groups/`,
        method: "GET",
          headers: {
            'Authorization': `Token ${access_token}`
          }
      };
      return httpRequest(config);
    }

    export let getGroupS = (id) => {
      let config = {
        url: `${host}/group-students/${id}`,
        method: "GET",
          headers: {
            'Authorization': `Token ${access_token}`
          }
      };
      return httpRequest(config);
    }

    export let getCourseS = (id) => {
      let config = {
        url: `${host}/group-students/?gr=${id}`,
        method: "GET",
          headers: {
            'Authorization': `Token ${access_token}`
          }
      };
      return httpRequest(config);
    }

    export let getContact= () => {
      let config = {
        url: `${host}/contact/`,
        method: "GET",
          headers: {
            'Authorization': `Token ${access_token}`
          }
      };

      return httpRequest(config);
    }

    export let putContact= (data) => {
      let config = {
        url: `${host}/contact/`,
        method: "PUT",
          headers: {
            'Authorization': `Token ${access_token}`
          }
      };

      return httpRequest(config);
    }


    export const postLogin= (formDataObj) => {
      let config = {
          url: 'https://api.codecraft.uz/auth/login/',
          method: "post",
          data: formDataObj,
        };
        return httpRequest(config);
      };
